window.bookSummaryJSON = "<p>The Spear of Lugh, one of the four Kingly Hallows of Ireland is in Chicago. And everyone, everyone wants it, for it is said that he who carries the spear into battle cannot be defeated. Among those who seek it are an agent of the infamous Wild Hunt; a mobster who knows far more about these things than he should; and of course both the Seelie and Unseelie Courts - the last people PI Mick Oberon would want getting hold of the spear....</p> <p>Performed by Eric Messner, Elizabeth Jernigan, Chris Genebach, Scott McCormick, Matthew Keenan, Richard Rohan, Bob Payne, Terence Aselford, Christopher Graybill, Bradley Smith, David Jourdan, Nora Achrati, J W Rone, Nanette Savard, Colleen Delany, Paul Reisman, Dylan Lynch, Tim Carlin, Kimberly Gilbert, Tia Shearer, Michael John Casey, Ken Jackson, Ren Kasey, Nick DePinto, Rose Elizabeth Supan, Mort Shelby.</p>"; 
